import React from "react";
import { connect } from "react-redux";

function Login(props) {
  const [open, setOpen] = React.useState(false);

  const toggle = () => {
    setOpen(!open);
  };

  const tryLogin = () => [console.log("please work")];

  return (
    <div className="login-root">
      <button className="open-login-button" onClick={toggle}>
        Login to save settings
      </button>

      {open ? (
        <div className="login-modal">
          <form>
            <input
              type="email"
              className="form-control"
              id="email"
              aria-describedby="emailHelp"
              placeholder="guitarscalefinder@gmail.com"
            />
            <input
              type="password"
              className="form-control"
              id="password"
              placeholder="CantAffordSitar"
            />
          </form>
          <div className="button-container">
            <button type="submit" className="login-button" onClick={tryLogin}>
              Login
            </button>
            <button type="close" className="close-button" onClick={toggle}>
              Close
            </button>
          </div>
        </div>
      ) : null}
    </div>
  );
}

function mapStateToProps(state) {
  return {};
}

function mapDispatchToProps(dispatch) {
  return {
    // loginUser: () =>
    // logOutUser: () => dispatch({ type: "LOG_OUT" }),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(Login);
